B.Fb=A.a(s(["\ub098\ub294 \uc131\uacbd\uc758 \ubaa8\ub4e0 \ube44\ubc00\uc744 \uc54c\uace0 \uc788\ub2e4.","\ud558\ub098\ub2d8\uc740 \uc9c4\ub9ac\ub97c \uc54c\uace0 \uc788\ub294 \uc0ac\ub78c\ub4e4\ub9cc \uad6c\uc6d0\ud558\uc2e0\ub2e4.","\uc9c4\ub9ac\ub294 \ud558\ub098\ub2d8\uacfc \ud2b9\ubcc4\ud55c \uad00\uacc4\ub97c \ub9fa\uc740 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uc218\uc5ec\ub418\ub294 \ud2b9\uad8c\uc774\ub2e4","\ub098\ub294 \ub2e4\ub978 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uc9c4\ub9ac\ub97c \uac00\ub974\uce60 \uc218 \uc788\ub2e4.","\ubaa9\uc0ac\ub4e4\uc740 \uc9c4\ub9ac\uc5d0 \uad00\uc2ec\uc774 \uc5c6\ub2e4.","\ub098\ub294 666\uc758 \ube44\ubc00\uc744 \uc54c\uace0 \uc788\ub2e4.","\ub098\ub294 \uc801\uadf8\ub9ac\uc2a4\ub3c4\uac00 \uc5b4\ub5a4 \uc874\uc7ac\uc778\uc9c0 \uc54c\uace0 \uc788\ub2e4.","\uc131\uacbd\uc740 \ucd5c\ud6c4\uc758 \uc2ec\ud310 \ub54c \uc9c4\ub9ac\ub97c \uc544\ub294 \uc0ac\ub78c\ub4e4\uc744 \ud734\uac70\uc2dc\ucf1c \ubcf4\ud638\ud558\uc2e4 \uac83\uc774\ub77c\uace0 \ub9d0\ud558\uace0 \uc788\ub2e4.","\ub098\ub294 \uc62c\ubc14\ub978 \uc2e0\ud559\uad00\uc744 \uac00\uc9c0\uace0 \uc788\ub294 \uc2e0\uc559\uc758 \uc9c0\ub3c4\uc790\ub97c \ub9cc\ub0ac\ub2e4.","\uc9c4\ub9ac\ub294 \uc228\uaca8\uc838 \uc788\ub2e4","\ub098\ub294 \uc62c\ubc14\ub978 \uc2e0\ud559\uad00\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4.","\uc8fc\ub958 \uad50\ud68c\ub294 \uc9c4\ub9ac\ub97c \ubaa8\ub978\ub2e4.","\uc9c4\ub9ac\ub97c \uc54c\uace0 \uc788\ub294 \uc0ac\ub78c\uc774 \ud558\ub098\ub2d8\uacfc \uad50\uc7ac\ud558\ub294 \uc0ac\ub78c\ub4e4\uc774\ub2e4.","\uc138\uacc4\ub294 \uc0ac\ud0c4\uc5d0 \uc18d\ud574\uc788\ub2e4.","\uc9c4\ub9ac\uc5d0\uc11c \ubc97\uc5b4\ub09c \ub300\ubd80\ubd84\uc758 \uad50\ud68c\ub294 \uad6c\uc6d0\uc5d0 \uc774\ub974\uc9c0 \ubabb\ud55c\ub2e4","\ub300\ubd80\ubd84\uc758 \uad50\ud68c\ub294 \ud558\ub098\ub2d8\uaed8\uc11c \ubb34\uc5c7\uc744 \uc6d0\ud558\uc2dc\ub294\uc9c0 \uad00\uc2ec\uc774 \uc5c6\ub2e4.","\ub9ce\uc740 \uc0ac\ub78c\ub4e4\uc774 \uc9c4\ub9ac\ub97c \ubaa8\ub978\ub2e4","\ub9ce\uc740 \uad50\ud68c\ub294 \uc9c4\ub9ac\uc5d0\uc11c \ubc97\uc5b4\ub098 \uc788\ub2e4","\uc774\uc2a4\ub77c\uc5d8\uc5d0 \uc120\uad50\ud558\ub294 \uac83\uc774 \uc911\uc694\ud55c \ubaa9\ud45c\ub2e4.","\uc9c4\ud654\ub860\uc740 \ud5c8\uad6c\ub2e4."]),t.s)
B.EJ=A.a(s(["\uc9c4\ud654\ub860\uc740 \ud604\uc2e4\uc774\ub2e4.","\uc9d0\uc2b9\uc758 \ud45c, 666\uacfc \uac19\uc740 \uc694\uc18c\ub294 \ub2e8\uc9c0 \uc0c1\uc9d5\uc774\ub098 \ud5c8\uc6b8\uc5d0 \ubd88\uacfc\ud55c \uac1c\ub150\uc774\ub2e4.","\uc694\ud55c\uacc4\uc2dc\ub85d\uc740 \ud604\uc2e4\uacfc \ub3d9\ub5a8\uc5b4\uc838 \uc788\ub2e4.","\ubaa8\ub4e0 \uc0ac\ub78c\uc774 \ub098\ub984\ub300\ub85c \uc131\uacbd\uc758 \uc9c4\ub9ac\ub97c \uc54c \uc218 \uc788\ub2e4.","\ub098\ub294 \ud3c9\ubc94\ud55c \uc2e0\uc559\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4."]),t.s)
B.FK=A.a(s(["\uc2dc\ub300\uac00 \uc9c0\ub098\uba74 \uc9c0\ub0a0\uc218\ub85d \uc0ac\ud68c\ub294 \uc545\ud558\uac8c \ubcc0\ud55c\ub2e4","\ub098\ub294 \uc131\uacbd \uc774\uc678\uc5d0\ub294 \uc9c4\uc9c0\ud558\uac8c \uacf5\ubd80\ud560 \uac00\uce58\uac00 \uc5c6\ub2e4\uace0 \uc0dd\uac01\ud55c\ub2e4","\uc131\uacbd\uc5d0 \uad00\ud574 \ub2e4\ub8e8\uc9c0 \uc54a\uc73c\uba74 \ubb34\uc775\ud558\ub2e4","\uc2ec\ub9ac\ud559\uc774\ub098 \uc0ac\ud68c\ud559 \uac19\uc740 \uc138\uc0c1\uc758 \ud559\ubb38\uc740 \uad50\ud68c\uc5d0 \ud544\uc694\ud558\uc9c0 \uc54a\ub2e4.","\ub300\uc911\ubb38\ud654\ub294 \ub098\uc058\ub2e4","\uad50\ud68c\ub294 \uc0ac\ud68c\uc640 \uac70\ub9ac\ub97c \ub450\uc5b4\uc57c \ud55c\ub2e4.","\uae30\ub3c5\uad50\ub294 \uc545\ud55c \uc0ac\ud68c\ub97c \uc815\ud654\ud55c\ub2e4.","\uad6d\uac00\ub294 \uae30\ub3c5\uad50\uc801 \uac00\uce58\ub97c \ub530\ub974\uace0 \uc815\uce58\uc778\ub4e4\uc740 \uae30\ub3c5\uad50\uc778\uc73c\ub85c\uc11c \uadf8 \uac00\uce58\ub97c \uc874\uc911\ud574\uc57c \ud55c\ub2e4","\ube44\uae30\ub3c5\uad50\uc801\uc778 \uc774\ub150\uc740 \uc0ac\ud68c\uc5d0\uc11c \uc0ac\ub77c\uc838\uc57c \ud55c\ub2e4.","\uc131\uacbd\uc5d0 \uc4f0\uc5ec \uc788\ub2e4\uba74 \uc0ac\uc2e4\uc774\ub2e4","\uc131\uacbd\uc740 \ubb34\uc624\ud558\ub2e4","\uc131\uacbd \uc774\uc678\uc5d0\uc11c\ub294 \uc9c4\ub9ac\ub97c \ucc3e\uc744 \uc218 \uc5c6\ub2e4","\uc131\uacbd\uc740 \ud558\ub098\ub2d8\uc5d0 \uc758\ud574 \uc800\uc791\ub418\uc5c8\ub2e4","\uc131\uacbd\uc744 \ube44\ud3c9\ud558\uac70\ub098 \ube44\ud310\ud560 \uc218 \uc788\ub2e4\ub294 \uc0dd\uac01\uc740 \uc2e0\uc131\ubaa8\ub3c5 \uc131\ub839\ud6fc\ubc29\uacfc \uac19\ub2e4","\uc608\uc218\ub294 \uc2e4\uc874\uc778\ubb3c\uc774\ub2e4","\uc608\uc218\uc758 \ub3d9\uc815\ub140 \uc218\ud0dc\ub294 \uacfc\ud559\uc801 \uc99d\uba85\uacfc \ubb34\uad00\ud558\uac8c \uc5ed\uc0ac\uc801 \uc0ac\uc2e4\uc774\ub2e4","\ucc3d\uc870\ub860\uc740 \uacfc\ud559\uc801 \uc99d\uba85\uacfc \ubb34\uad00\ud558\uac8c \uc5ed\uc0ac\uc801 \uc0ac\uc2e4\uc774\ub2e4","\ubaa8\uc138\uc624\uacbd\uc758 \uc800\uc790\ub294 \ubaa8\uc138\uc774\ub2e4.","\uad6c\uc57d \uc608\uc5b8\uc790\ub4e4\uc740 \ud558\ub098\ub2d8\uc5d0\uac8c \uc131\uacbd\uc758 \uc6d0\ubcf8\uc744 \uc601\uac10\uc744 \ud1b5\ud574 \ubc1b\uc544 \uadf8 \ub300\ub85c \uc4f0\uc5ec\uc838 \uc624\ub298\ub0a0\uae4c\uc9c0 \uc804\ud574\uc9c4\ub2e4."]),t.s)
B.Gg=A.a(s(["\uad50\ud68c\uc5d0\uc11c \uc608\ubc30 \ub9d0\uace0 \ub2e4\ub978 \ud65c\ub3d9\uc744 \ud560 \ud544\uc694\uac00 \uc5c6\ub2e4","\uad50\ud68c\ub294 \uc885\uad50\ud65c\ub3d9\ub9cc \ud558\uba74 \ub41c\ub2e4","\uad50\ud68c\ub294 \uc0ac\ud68c\uc5d0\uc11c \uc5b4\ub5a4 \uae30\ub2a5\uc744 \uc218\ud589\ud560 \ud544\uc694\uac00 \uc5c6\ub2e4","\uc885\uad50\ud65c\ub3d9\uc740 \uc0ac\ub78c\ub4e4\uc758 \ub9c8\uc74c\uac00\uc9d0\uc744 \uc911\uc694\ud558\uac8c \uc0dd\uac01\ud574\uc57c \ud55c\ub2e4.","\uc885\uad50\uc2dc\uc124\uc5d0\uc11c \uc0ac\ud68c\ubcf5\uc9c0\uc2dc\uc124\uc744 \uacb8\ud574 \uc218\ud589\ud558\ub294 \uac83\uc740 \ubd80\uc801\uc808\ud558\ub2e4","\uc885\uad50\ub2e8\uccb4\ub294 \uc0ac\ud68c\uc5d0\uc11c \uacf5\uc775\uc744 \uc99d\uc9c4\ud558\ub294 \ud65c\ub3d9\uc744 \ud558\uba74 \uc548\ub41c\ub2e4",u.Y,"\uae30\ub3c5\uad50\ub294 \uc885\uad50\uc801 \uc774\uc678\uc758 \uc601\uc5ed\uc5d0\uc11c \uc190\uc744 \ub5bc\uc57c \ud55c\ub2e4","\uae30\ub3c5\uad50\uc778\uc774\ub77c\uba74 \uc0ac\ud68c\uc5d0\uc11c \ubb34\uc5b8\uac00 \ud2b9\uc218\ud55c \ud65c\ub3d9\uc5d0 \ub354 \uc9d1\uc911\ud574\uc57c \ud55c\ub2e4.","\uc885\uad50\ub294 \uc0ac\ud68c\uc758 \ud1b5\ud569\uacfc \uc548\ub155\uc5d0 \ubd09\uc0ac\ud574\uc11c\ub294 \uc548\ub41c\ub2e4.","\uc5ed\uc0ac\uc801\uc73c\ub85c \uc99d\uba85\ub418\uc9c0 \uc54a\uc740 \uad50\ub9ac\ub294 \ubbff\uc744 \ud544\uc694\uac00 \uc5c6\ub2e4","\ubbff\uc744 \ub9cc\ud55c \uad50\ub9ac\ub294 \uacfc\ud559\uc73c\ub85c\ub098 \uc5ed\uc0ac\uc801\uc73c\ub85c\ub098 \uace0\uace0\ud559\uc801 \uc2e4\uc99d\ub418\uc5b4\uc57c \ud55c\ub2e4.","\uacfc\ud559\uc801\uc73c\ub85c \ub9d0\uc774 \ub418\uc9c0 \uc54a\ub294\ub2e4\uba74 \uc131\uacbd\uc740 \ubd80\uc815\ub420 \uc218 \uc788\ub2e4.","\uc2e0\uc740 \uc99d\uba85\ub418\uc9c0 \uc54a\uc558\uac70\ub098 \uc99d\uba85\ub420 \uc218 \uc5c6\ub2e4.","\uc885\uad50\ub294 \ubc18\uc9c0\uc131\uc8fc\uc758\uc758 \ud55c \ud615\ud0dc\uc774\ub2e4","\uc2e4\uc99d\ub420 \uc218 \uc788\ub294 \uba85\uc81c\ub9cc \uc9c4\ub9ac\uac00 \ub420 \uc218 \uc788\ub2e4.","\ucc3d\uc870\ub860\uc740 \uacfc\ud559\uc801\uc73c\ub85c \ub9d0\uc774 \uc548\ub41c\ub2e4","\uc9c4\ud654\ub860\uc774 \uc138\uacc4\ub97c \uc798 \uc124\uba85\ud558\ubbc0\ub85c \uc885\uad50\ub294 \ud569\ub9ac\uc801\uc774\uc9c0 \ubabb\ud558\ub2e4","\uacfc\ud559\uc740 \uc885\uad50\ub97c \ub3c4\ud0dc\uc2dc\ud0ac \uac83\uc774\ub2e4","\uc885\uad50\ub294 \uae30\uc220 \ubc1c\uc804\uc744 \ubc29\ud574\ud55c\ub2e4","\uae30\ub3c5\uad50\uc778\ub9cc \uad6c\uc6d0\ubc1b\uc744 \uc218 \uc788\ub2e4\uace0 \ub9d0\ud558\ub294 \uad50\ub9ac\ub294 \ubc30\ud0c0\uc801\uc774\uace0 \ud604\uc2dc\ub300\uc5d0 \ubc18\ub300\ub418\ub294 \uac1c\ub150\uc774\ub2e4","\ubd88\uad50\ub3c4\ub4e4\ub3c4 \uad6c\uc6d0\ubc1b\uc744 \uc218 \uc788\ub2e4","\ubaa8\ub4e0 \uc885\uad50\ub294 \uac19\uc740 \ubc29\ud5a5\uc131\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4"]),t.s)
B.EI=A.a(s(["\ub098\ub294 \ubbff\uc74c\uc774 \uc5c6\uac70\ub098 \uc57d\ud558\ub2e4.","\ub098\ub294 \uad6c\uc6d0\ubc1b\uc9c0 \ubabb\ud55c \uac83\ub9cc \uac19\ub2e4.","\ud558\ub098\ub2d8\uc5d0\uac8c \ubc84\ub9bc\ubc1b\uc744\uae4c \ubd88\uc548\ud558\ub2e4.","\ubc14\ub78c\uc9c1\ud55c \uc885\uad50\uc778\uc774 \ub418\uae30 \uc704\ud574\uc11c \ubb34\uc5c7\uc778\uac00 \ud574\uc57c\ud560 \uac83\ub9cc \uac19\ub2e4.","\uc885\uad50\uc0dd\ud65c\uc744 \ud574\ub3c4 \ub9c8\uc74c \uc18d\uc5d0 \ubd88\uc548\uc774 \uc7a0\uc7ac\uc6cc\uc9c0\uc9c0 \uc54a\ub294\ub2e4."]),t.s)
B.Fp=A.a(s(["\ub098\ub294 \uac74\uac15\ud55c \ubbff\uc74c\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4\uace0 \uc790\ubd80\ud55c\ub2e4.","\ud558\ub098\ub2d8\uc740 \ub098\ub97c \ud558\ub791\ud558\uc2e0\ub2e4.","\uc885\uad50\uc0dd\ud65c\uc740 \ub098\uc5d0\uac8c \ud3c9\uc548\uacfc \uc704\uc548\uc744 \uac00\uc838\ub2e4 \uc900\ub2e4."]),t.s)
